local s = Instance.new("Sound",game.CoreGui)
s.SoundId = "rbxassetid://1349857767"
s.Volume = 1
s:Play()

spawn(function()
	local colorMap = {
		[26] = Color3.fromRGB(141, 38, 21),
		[42] = Color3.fromRGB(174, 61, 43),
		[30] = Color3.fromRGB(159, 56, 44),
		[34] = Color3.fromRGB(189, 56, 44)
	}
	
	local guis = {}
	local events = {}
	
	local function reskin()	
		for nextGui,_ in pairs(guis) do
			if nextGui:FindFirstChild("bg") and nextGui.bg:FindFirstChild("credits") then
				nextGui.bg.credits.Text = "Raptors Hub V2"
			end

			for i,v in pairs(nextGui:GetDescendants()) do
				if v:IsA("GuiObject") then
					if not events[v] then
						events[v] = {
							v:GetPropertyChangedSignal("BackgroundColor3"):Connect(reskin),
							v:GetPropertyChangedSignal("BorderColor3"):Connect(reskin)
						}
					end
					v.BackgroundColor3 = colorMap[math.floor(v.BackgroundColor3.R*255)] or v.BackgroundColor3
					v.BorderColor3 = colorMap[math.floor(v.BorderColor3.R*255)] or v.BorderColor3
					if v:IsA("TextLabel") then
						v.TextColor3 = colorMap[math.floor(v.TextColor3.R*255)] or v.TextColor3
					elseif v:IsA("ImageButton") then
						v.ImageColor3 = colorMap[math.floor(v.ImageColor3.R*255)] or v.ImageColor3
					end
				end
			end
		end
	end

	local function addGui(gui)
		if not gui:WaitForChild("bg",5) or guis[gui] then return end
		guis[gui] = true
		gui.DescendantAdded:Connect(function()
			spawn(reskin)
		end)
		reskin()
	end

	for i,v in pairs(game:GetService("CoreGui"):GetChildren()) do 
		spawn(function() addGui(v) end)
	end

	game:GetService("CoreGui").ChildAdded:Connect(addGui)
end)

